import React from "react";

export default function UnitConversion(props) {
  return (
    <div className="unit-conversion">
      <a href="/" id="celsius-link">
        °C
      </a>
      <span className="divider"> | </span>
      <a href="/" id="fahrenheit-link">
        °F
      </a>
    </div>
  );
}
